import axios from './axios';

export const getRooms = async (houseId) => {
  const { data } = await axios.get(`/houses/${houseId}/rooms`);
  return data;
};

export const getRoom = async (roomId) => {
  const { data } = await axios.get(`/rooms/${roomId}`);
  return data;
};
